import React from "react";

function ToDoItem(props) {
    return(
        <div>
            <input type="checkbox" 
                checked={props.item.checked} 
                onChange={() => props.handleChange(props.item.id)} 
            />
            <label>{props.item.text}</label><br />
        </div>
    )
}

export default ToDoItem;
